import React from 'react';
import { Button, Container } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function Popup() {
  return (
    <Container>
      <Button variant="primary">React-Bootstrap Button</Button>
    </Container>
  );
}

export default Popup;
